import React from "react";
import Nav from "../Nav/index";
import "./index.less";
export default function Block() {
  return (
    <div>
      <div>
        <Nav></Nav>
      </div>
      <main className="block-container">
        <div className="block-con">
          <h2 className="title">Blocks</h2> <div>内容区</div>
        </div>
      </main>
    </div>
  );
}
